settings.markdownCss:
.card {
   width: 100%;
   height: 100%;
}

.card .content {
   display: flex;
   flex-direction: row;
   align-items: center;
   justify-content: space-between;
   height: 100%;
}

.card .content .column {
    display: flex;
    margin-left: 50px;
    margin-right: 50px;
    align-items: center;
    flex-direction: row;
    justify-content: space-between;
}
.status_bar{
    width: 250px;
    display: flex;
    align-items: center;
    flex-direction: row;
    justify-content: space-between;
}
.status_bar_notification{
    height: 22px;
    margin-top: -10px;
    font-size: 16px;
    color: white;
    border-radius: 20%;
    padding: 0px 8px;
    background-color: #00CDFF;
}
.status_bar_notification_red{
    height: 24px;
    margin-top: -10px;
    font-size: 16px;
    color: white;
    border-radius: 20%;
    padding: 2px 8px;
    background-color: red;
}
.card h1 {
    text-transform: uppercase;
    font-size: 20px;
    font-weight: bold;
    margin: 0px;
    padding:0px;
    line-height: 32px;
    font-family: Arial;
    color: #ffffff;
}
.card .description {
    font-size: 20px;
    color: #999;
}

.fa{
    font-size: 30px;
    text-align: center;
    padding-bottom: 0px;
    display: flex;
    flex-direction: row;
    color: #ffffff;
}
.fas:hover{
    opacity: 0.5;
    cursor: pointer;
}

